package com.problemsolving;

public class FiveTable {

	static void table() {

		// table printing

		int num = 5;
		for (int i = 1; i <= 10; i++) {
			System.out.println(num + " * " + i + " = " + num * i);

		}

	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		table();

	}

}
